import Iterm from "./Iterms";
import Iphone from "../Iphone";
const Product = (props) => {
  return (
    <>
      {props.product.map((product, id) => (
        <div>
          <Iphone phone={phone} key={id} />
          <Iterm details={product} key={id} />
        </div>
      ))}
    </>
  );
};

export default Product;
